A fiber is a lightweight process of execution that is cooperatively scheduled with other fibers. Each fiber is like a little system unto itself that can pass messages to other fibers. To create a fiber, use the fiber keyword: counter = fiber { i = 0 loop { yield i; i = i + 1 }
} print counter () -> prints 0
print counter () -> prints 1
print counter () -> ... The yield keyword suspends the current fiber and returns a value to the calling fiber. yield can also be used to pass data into a fiber. passing_yield = fiber { print "hello" result = yield "banana" print result "yes"
} passing_yield "first" -- prints "hello" then evaluates to "banana"
passing_yield "second" -- prints "second" then evaluates to "yes"
passing_yield "uh oh" -- raises an error, fiber is done To build more complex systems, you can build fibers with functions: -- a function that returns a fiber
flopper = this that -> fiber { loop { yield this yield that }
} apple_banana = flopper "Apple" "Banana" apple_banana () -- evaluates to "Apple"
apple_banana () -- evaluates to "Banana"
apple_banana () -- evaluates to "Apple"
apple_banana () -- ... you get the point Of course, the possibilities are endless. In addition, fibers, while usually being ran in the context of another, all act as peers to each-other. If you have a reference to a fiber, it's possible to transfer to it forgetting the context in which it was called. To switch to a fiber, use switch. banana_and_end = fiber { print "banana ending!"
} print "the beginning..."
switch banana_and_end
print "the end." "the end." is never displayed. 'Tis not the end, 'tis but the beginning... 'tis hackin' time!

